import React from 'react';
import classes from './Line.module.css';

const Line = ({ lineWidth, active }) => {
    return (
      <div
        className={`${classes.line} ${active ? classes.activeLine : ''}`}
        style={{ width: `${lineWidth}px` }}
      ></div>
    );
  };
  
  export default Line;
